import Nav from './Nav';
import '../styles/Style.css';
import '../styles/sass/home.scss';
import Head from 'next/head'

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>NextJS</title>
        <link rel='stylesheet' href='https://bootswatch.com/4/darkly/bootstrap.min.css'></link>
      </Head>
      <Nav />
      {props.children}
    </div>
  );
}

export default Layout;
